import { AppBar } from '@mui/material'
import React from 'react'

export default function Header() {
  return (
    <>
      {/* TODO backgroundColor 테마적용 */}
      <AppBar
        position="fixed"
        sx={{
          zIndex: theme => theme.zIndex.drawer + 1,
          color: '#9a939b',
          backgroundColor: '#4c3c4c',
        }}
      ></AppBar>
    </>
  )
}
